- q: '. as {$a, $b: [$b, $c]} | [$a, $b, $c]'
  in: {"a": 1, "b": [2, {"d": 3}]}
  out:
  - [1, [2, {"d": 3}], {"d": 3}]
  v: '[1.6, )'

- q: '. as {$a, $b: [$b, $b]} | [$a, $b]'
  in: {"a": 1, "b": [2, {"d": 3}]}
  out:
  - [1, [2, {"d": 3}]]
  v: '[1.6, )'

- q: '. as {$a, $b: [$c, $c]} | [$a, $b, $c]'
  in: {"a": 1, "b": [2, {"d": 3}]}
  out:
  - [1, [2, {"d": 3}], {"d": 3}]
  v: '[1.6, )'

- q: '. as [$a, $a] | $a'
  in: [1, 2]
  out:
  - 2
  v: '[1.6, )'

- q: '. as {a: $a, b: $a} | $a'
  in: {"a": 1, "b": 2}
  out:
  - 1
  v: '[1.6, )'
